    public class IisRepository : IIisRepository
    {
        public void Add(WebHotel entity)
        {
            var server = entity.Server;
            try
            {
                var name = entity.Domain;
                using(var serverMgr = ServerManager.OpenRemote(server.InternalIp)) {

                    var path = "\\\\" + server.InternalIp + "\\wwwroot\\" + name;
                    var websiteDirectory = Directory.CreateDirectory(path);

                    var html = "<!DOCTYPE html><html lang=\"en\" xmlns=\"http://www.w3.org/1999/xhtml\" ><head><meta charset=\"utf-8\" /><title>Welcome to AxaHosting</title><style>body {background: #34495e;}img {position: fixed; /* or absolute */top: 50%;left: 50%;margin-top: -366px;margin-left: -394px;}</style></head><body><img src=\"data:image/png;base64,\" /></body></html>";


                    File.WriteAllText(path + "\\index.html", html);
                    
                    // Create App Pool
                    var appPool = serverMgr.ApplicationPools.Add(entity.AppPoolName);
                    appPool.ManagedRuntimeVersion = "v4.0";

                    // Generate iis cpu
                    appPool.Cpu.Attributes["limit"].Value = 20000;
                    if (entity.Product.MaxCpu == 200)
                    {
                        appPool.Cpu.Attributes["limit"].Value = 40000;
                    }


                    


                    // End Create App Pool

                    // Create web site
                    var strhostname = name;
                    var stripaddress = server.ExternalIp; // ip address
                    var bindinginfo = stripaddress + ":80:" + strhostname;

                    var bWebsite = serverMgr.Sites.FirstOrDefault(c => c.Name == name);
                    if (bWebsite == null)
                    {
                        var mySite = serverMgr.Sites.Add(name, "http", bindinginfo, "C:\\inetpub\\wwwroot\\" + name);
                        mySite.ApplicationDefaults.ApplicationPoolName = name;
                    }
                    serverMgr.CommitChanges();
                }
            }
            catch
            {
                // ignored
            }
        }

        

        public void Update(WebHotel entity)
