        public void Delete(WebHotel entity)
        {
            var server = entity.Server;
            try
            {
                var name = entity.Domain;
                using (var serverMgr = ServerManager.OpenRemote(server.InternalIp))
                {

                    try
                    {
                        Directory.Delete("\\\\"+ server.InternalIp + "\\wwwroot\\" + name, true);
                    }
                    catch
                    {

                    }


                    var bWebsite = serverMgr.Sites.FirstOrDefault(c => c.Name == name);
                    if (bWebsite != null)
                    {
                        serverMgr.Sites.Remove(bWebsite);
                    }

                    var appPool = serverMgr.ApplicationPools.FirstOrDefault(c => c.Name == name);
                    if (appPool != null)
                    {
                        serverMgr.ApplicationPools.Remove(appPool);
                    }

                    serverMgr.CommitChanges();
                }
            }
            catch
            {
                // ignored
            }
        }

