        public int? GetIisId(WebHotel entity)
        {
            var server = entity.Server;
            try
            {
                var name = entity.Domain;
                using (var serverMgr = ServerManager.OpenRemote(server.InternalIp))
                {
                    var bWebsite = serverMgr.Sites.FirstOrDefault(c => c.Name == name);
                    if (bWebsite != null)
                    {
                        return (int?) bWebsite.Id;
                    }
                    return null;
                }
            }
            catch
            {
                return null;
                // ignored
            }
        }

        public int GetAmountOfSites(Server server)
        {
            var sites = 0;
            var serverMgr = ServerManager.OpenRemote(server.InternalIp);
            sites = serverMgr.Sites.Count;
            serverMgr.Dispose();
            return sites;
        }
